import './Nav.css';
import { BrowserRouter as Router, Link, Route } from 'react-router-dom';

import Home from './Home';


function Nav() {
  return(
      <div>
          <Router>
        <nav>
        <Link to="/">
            <h3>Home</h3>
        </Link>
        <ul className ="nav-links">
            <Link to='/login'>
                <li>Login</li>
            </Link>
            <Link to='/browse'>
                <li>Music</li>
            </Link>

        </ul>

    </nav>


    <Route path="/" component={Home} exact />


    </Router>
    </div>


  );
}

export default Nav;
